<?php
require_once __DIR__ . '/vendor/autoload.php';

use Mpdf\Mpdf;

try {
    $mpdf = new Mpdf();
    $mpdf->WriteHTML('<h1>Hello world!</h1>');
    $mpdf->WriteHTML('<p>ai toma</p>');
    $mpdf->WriteHTML('<img src="data:image/jpeg;base64," alt="Google">');

    $mpdf->Output();
} catch (\Exception $e) {
    echo 'Erro: ' . $e->getMessage();
}